import React from "react";

function EmployeeDetail(props) {
  return (
    <tr className="text-center">
      <img alt={props.title} className="img-fluid" src={props.src} style={{ margin: "0 auto" }} />
      <p>{props.firstName}</p>
      <p>{props.email}</p>
      <p>{props.city}</p>
    </tr>
  );
}

export default EmployeeDetail;
